import React from 'react'
import styled from 'styled-components'

import NavItems from './MenuNavItems.js'

const FixedWrapper = styled.header`
    width: 100%;
    position: relative;
    z-index: 2;
    background-color: var(--color-white);
    padding: 0rem 2rem;
    left: 0;
    width: 100%;
    height: 8rem;
`
const Container = styled.div`
    width: 100%;
    max-width: 140rem;
    margin: 0 auto;
    height: 100%;
`
const Wrapper = styled.div`
    display: flex;
    height: 100%;
    justify-content: flex-end;
`

const MenuNavbar = () => {
    return(
        <FixedWrapper>
            <Container>
                <Wrapper>
                    <NavItems/>
                </Wrapper>
            </Container>
        </FixedWrapper>
    )
}

export default MenuNavbar
